		-- ☆ //   sounds   // ☆ --

		local assets = {
			tarkov = ',';
			neverlose = ''
		};

		for name, sound in assets do
			local name = 'eternal/sounds/' .. name .. '.mp3';

			if (not isfile(name)) then
				writefile(name, crypt.base64.decode(sound));

				repeat fwait(); until isfile(name);
			end;
			
			sounds[name] = getcustomasset(name .. '.mp3');
		end;
	end));
end;

