				} or {}
			);
		end;

		local function chop(tree)
			fire_server(storage.Events.Tools.Charge, {
				Target = tree;
				HitPosition = vector3_new(tree.Position.X, tree.Position.Y - (tree.Size.Y / 2), tree.Position.Z);
			});
		end;

