					end;

					ore_cache[index] = nil;
				end;
			end;

			if (flags.trees_esp_enabled.bool) then
				for _, tree in spawned_trees:GetChildren() do
					if (table_find(flags.trees_esp_selected, tree.Name)) then
						cache(tree, tree_cache);
					end;
				end;
	
				for _, tree in hidden_trees:GetChildren() do
					if (table_find(flags.trees_esp_selected, tree.Name)) then
